import React from 'react'
import {connect} from 'react-redux'
import { getItems } from '../actions';
import {NavLink} from 'react-router-dom'
import {Route} from 'react-router-dom'
import Post from './Post'
import Listing from './Listing'
import Account from './Account'

class Tech extends React.Component {

    componentDidMount(){
        this.props.getItems()
    }
    render(){
    return(
        <div>
            <NavLink to='/technology'>Listings</NavLink>
            <NavLink to='/technology/post'>Post</NavLink>
            <NavLink to='/technology/account'>Account</NavLink>

            <Route exact path='/technology/post' component={Post} />
            <Route exact path='/technology/account' component={Account} />
            <Route exact path='//technology' component={Listing} />
               {this.props.tech.map((i) => {
                  return(
                    <div>
                        <img src={i.picture} alt='its a penis' />
                        <h2>{i.name}</h2>
                        <h2>${i.cost}</h2>
                        <h2>{i.description}</h2>
                        <h2>{i.user}</h2>
                    </div>      
                  )
               })}

        </div>

    )
    }
}

const mapStateToProps = (state) => {
    return({
      ...state,
      tech: state.tech,

    })
  }

  export default connect(mapStateToProps, {getItems})(Tech);
